import React from "react";

export default function LoginPage() {
  return (
    <div className="flex items-center justify-center min-h-screen bg-gray-100">
      <div className="flex flex-col items-center">
        <input
          type="text"
          placeholder="Enter something..."
          // Add 'focus:border-blue-500' to change the border color to blue when the input is focused
          className="mb-4 border-2 border-gray-300 bg-white h-10 px-5 rounded-lg text-sm focus:outline-none focus:border-blue-500"
        />
        <button
          type="submit"
          // Add 'active:bg-blue-700' to change the background color to a darker blue when the button is clicked
          className="border-2 border-gray-300 bg-blue-500 text-white h-10 px-5 rounded-lg text-sm focus:outline-none hover:bg-blue-600 active:bg-blue-700"
        >
          Submit
        </button>
      </div>
    </div>
  );
}
